import Vue from 'vue'
import Router from 'vue-router'
import home from './views/Home.vue'
import overview from './views/Overview.vue'
import post from './views/Post.vue'
import trolley from './views/Trolley.vue'
 
Vue.use(Router)
 
export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'HomePage',
      component: home
    },
    {
      path: '/overview',
      name: 'OverviewPage',
      component: overview
    },
    {
      path: '/postInfo',
      name: 'PostPage',
      component: post
    },
    {
      path: '/trolley',
      name: 'TrolleyPage',
      component: trolley
    }
  ]
})
